const Breakpoints = () => {
  const breakpoints = {
    id: 900,
    bps: [
      { id: 901, bpTitle: 'bpXXS', bpValue: '0' },
      { id: 902, bpTitle: 'bpXS', bpValue: '420px' },
      { id: 903, bpTitle: 'bpSM', bpValue: '576px' },
      { id: 904, bpTitle: 'bpMD', bpValue: '768px' },
      { id: 905, bpTitle: 'bpLG', bpValue: '992px' },
      { id: 906, bpTitle: 'bpXL', bpValue: '1200px' },
      { id: 907, bpTitle: 'bpXXL', bpValue: '1400px' },
    ],
  };
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle fontStyled primary'>
          <h5 className='fsH5 pb2'>Breakpoints</h5>
        </div>

        <div className='rowWrapper'>
          {breakpoints.bps.map((bp) => (
            <div key={bp.id} className='row alignCenter mb1'>
              <div className='col3 fwBold'>
                <p className='fsSM'>{bp.bpTitle}:</p>
              </div>
              <div className='col9'>
                <h1 className='fsSM fontDefault'>{bp.bpValue}</h1>
              </div>
            </div>
          ))}
        </div>
      </div>
    </>
  );
};

export default Breakpoints;
